/* harmony default export */ __webpack_exports__["default"] = ("<mat-tab-group\n  [(selectedIndex)]=\"index\"\n  [backgroundColor]=\"background\"\n  dynamicHeight=\"true\"\n  mat-align-tabs=\"center\"\n>\n  <mat-tab label=\"Overview\">\n    <mat-card class=\"stages-card\">\n      <h2><strong>1 &nbsp;&nbsp; About the Process</strong></h2>\n      <hr />\n      <br />\n      <mat-card-content>\n        <p>\n          There are three types of users namely\n          <b>Student, Faculty, Super Admin</b>. And there are four roles namely\n          <b>Student, Faculty, Co-ordinator, Super Admin</b>. We will have a\n          quick glance on how the process works. We will go through these roles\n          in detail first.\n        </p>\n        <ul>\n          <li>\n            <h4>Students</h4>\n            <p>\n              No special priviliges given. They have to give their preferences\n              of projects.\n            </p>\n          </li>\n\n          <li>\n            <h4>Faculty</h4>\n            <p>\n              No special priviliges given. Faculty have to select the programs\n              which they wish to support i.e the programs in which they would\n              like to float their projects. They are responsible for giving the\n              student preference for the projects they floated.\n            </p>\n          </li>\n\n          <li>\n            <h4>Co-ordinator</h4>\n            <p>\n              Presets help to control the number of students assigned to each\n              faculty. These are assigned by the Co-ordinator of each program\n              and is unique to a program. Co-ordinator is responsible for\n              setting the deadlines of the programs. Mails will be sent to the\n              particular groups of users about the deadline. Please note that\n              this is not automated for any of the stages i.e you have to click\n              the Send Mails button.\n            </p>\n            <ol>\n              <li>\n                <h4>Presets</h4>\n\n                <ul>\n                  <li>\n                    <b>Project Cap</b>: This is the maximum number of projects\n                    each faculty can float. This is not set to anything in the\n                    start. If not set, no faculty will be able to add projects.\n                  </li>\n                  <li>\n                    <b>Student Cap</b>: This is the maximum number of students\n                    each project can intake. This is set to 1 by default.\n                  </li>\n\n                  <li>\n                    <b>Students Per Faculty</b>: This is the maximum number of\n                    students each faculty can intake considering all the\n                    projects they floated. This is not set to anything in the\n                    start.\n                  </li>\n                  <li>\n                    <b>Number of Students</b>: This is the number of students\n                    involved in the program. This is not set to anything in the\n                    start.\n                  </li>\n                </ul>\n              </li>\n              <li>\n                <h4>Priviliges</h4>\n                <ul>\n                  <li>\n                    Co-ordinator can access the details of students & faculty\n                    who opted for the program.\n                  </li>\n                  <li>\n                    Co-ordinator can remove any student or faculty who opted for\n                    that program.\n                  </li>\n                  <li>\n                    Co-ordinator has the access to deadlines and can change\n                    deadlines.\n                  </li>\n                </ul>\n              </li>\n            </ol>\n          </li>\n\n          <li>\n            <h4>Super Admin</h4>\n            <ul>\n              <li>\n                Super Admin has the access to the database.\n              </li>\n              <li>\n                Super Admin is responsible for selecting the program\n                Co-ordinators before the start of the Allocation.\n              </li>\n              <li>\n                They have the privilige to add programs.\n              </li>\n            </ul>\n          </li>\n        </ul>\n\n        <br />\n        <h4>Flow of the Process</h4>\n        <ul>\n          <li>\n            Before the start of the allocation all the students and faculty have\n            to register into the application.\n          </li>\n          <li>\n            The Super Admin has to choose the Co-ordinators of each program.\n            Note that every program should have a unique Co-ordinator.\n          </li>\n          <li>\n            The Co-ordinators of each program have to start the allocation by\n            setting the first deadline and fillng in the presets. On setting the\n            first deadine the stages start i.e it will go to stage 1.\n          </li>\n          <li>\n            <b>Start of Stage 1</b>\n          </li>\n          <li>\n            Now the faculty have to add their projects to the programs they\n            chose to support.\n          </li>\n          <li>\n            <b>End of Stage 1</b>\n          </li>\n          <li>\n            Co-ordinators have to proceed to the next stage by hitting the\n            proceed button. Co-ordinators have to make sure that no faculty have\n            violated the presets, otherwise you wont be able to move to the next\n            stage.\n          </li>\n          <li>\n            <b>Start of Stage 2</b>\n          </li>\n          <li>\n            Students have to fill in their preferences.\n          </li>\n          <li>\n            <b>End of Stage 2</b>\n          </li>\n          <li>\n            Co-ordinator has to proceed to the next stage and set the deadline\n            for this stage.\n          </li>\n          <li>\n            <b>Start of Stage 3</b>\n          </li>\n          <li>\n            Faculty have to fill in their preferences of students for each\n            project they floated.\n          </li>\n          <li>\n            <b>End of Stage 3</b>\n          </li>\n          <li>\n            <b>Stage 4 is Allocation</b>\n          </li>\n        </ul>\n        <br />\n\n        <h2><strong>2 &nbsp;&nbsp; Stages</strong></h2>\n        <hr />\n        <br />\n        <p>\n          The project allocation consists of four stages namely Creating\n          Projects, Student Preference, Faculty Preference and Project\n          Allocation. This is a quick overview as to understand the process.\n        </p>\n        <ul>\n          <li>\n            <h4>Stage 1 : Creating Projects</h4>\n            <p>\n              In this stage :\n            </p>\n            <ol>\n              <li>\n                The faculty can <b>ADD/EDIT/DELETE</b> projects. Note that these\n                options will be disabled in the further stages.\n              </li>\n              <li>\n                Sometimes you wont be able to add any projects because you may\n                be violating certain presets set by the Co-ordinator of that\n                program. In such case you need to communicate with the\n                Co-ordinator and take necessary steps.\n              </li>\n              <li>\n                The Save Preferences button in the Students Tab in each project\n                will be disabled. Please refrain from clicking it.\n              </li>\n              <li>\n                Students preferences will be locked i.e students wont be able to\n                edit their preferences.\n              </li>\n              <li>\n                Sometimes you will be logged out of the application. Dont worry\n                this is because of session expiry or because of any server\n                error. In the later case please contact us.\n              </li>\n            </ol>\n          </li>\n          <br />\n          <li>\n            <h4>Stage 2 : Student Preferences</h4>\n            <p>\n              In this stage :\n            </p>\n            <ol>\n              <li>\n                Faculty's <b>ADD/EDIT/DELETE</b> options are disabled from this\n                stage and through out.\n              </li>\n              <li>\n                Students can now give their preferences.\n                <b\n                  >Please do note that if you dont give any preference, you will\n                  be alloted a random project</b\n                >.\n              </li>\n            </ol>\n          </li>\n          <br />\n          <li>\n            <h4>Stage 3 : Faculty Preferences</h4>\n            <p>\n              In this stage :\n            </p>\n            <ol>\n              <li>\n                Faculty have to give their preference in the Student tab in each\n                project section. You can Save Preferences how many ever times\n                you want. Note that the latest save will be considered for the\n                allocation.\n              </li>\n              <li>\n                Students wont be able to edit their preferences further.\n              </li>\n            </ol>\n          </li>\n          <br />\n          <li>\n            <h4>Stage 4 : Project Allocation</h4>\n            <p>\n              In this stage :\n            </p>\n            <ol>\n              <li>\n                Project Allocation allocates program wise, and after the\n                allocation make sure to click on the Send Mails button to send\n                mails to all the members involved in that particular program\n                indicating the end of the allocation.\n              </li>\n              <li>\n                Now you can exclude projects from the allocation by deselecting\n                them in the Project tab. Go through the video to understand this\n                better.\n              </li>\n              <li>\n                Students will be able to see their project alloted in their home\n                page. It will appear as an expansion panel in place of the\n                timeline.\n              </li>\n            </ol>\n          </li>\n        </ul>\n        <br />\n        <h2><strong>3 &nbsp;&nbsp; Contact Us</strong></h2>\n        <hr />\n        <br />\n        <ul>\n          <li>\n            If you find any issues in the portal you can open an issue\n            <a\n              href=\"https://github.com/subhash011/Project-Allocation/issues\"\n              target=\"_blank\"\n            >\n              here</a\n            >. Please consider this as your first option.\n          </li>\n          <br />\n          <li>\n            Try using the issue tracker using the link given above. If you find\n            it difficult, please feel free to mail us.<br />\n            Mail-Id's : <br />\n            Sai Vamsi : 111801002@smail.iitpkd.ac.in <br />\n            Subhash : 111801042@smail.iitpkd.ac.in\n          </li>\n        </ul>\n        <br />\n        <h2><strong>4 &nbsp;&nbsp; Additional Information</strong></h2>\n        <hr />\n        <br />\n        <ul>\n          <li>\n            <mat-card-actions>\n              For more information on the project allocation algorithm and it's\n              implementation you can download the report form the given link :\n              <a href=\"../../../../assets/BTP_Report.pdf\" download>Report</a>\n            </mat-card-actions>\n          </li>\n        </ul>\n      </mat-card-content>\n      <pre></pre>\n    </mat-card>\n  </mat-tab>\n  <mat-tab label=\"Student\">\n    <div class=\"container\">\n      <h1 class=\"head\">\n        <b><u>Student's guide for the application.</u></b>\n      </h1>\n      <video class=\"video\" #helpvid controls name=\"media\">\n        <source src=\"../../../assets/Student.mp4\" type=\"video/mp4\" />\n      </video>\n      <!-- <iframe #helpvid class=\"video\" width=\"967\" height=\"544\" src=\"../../../assets/Student.mp4\" frameborder=\"0\" allowfullscreen></iframe> -->\n      <br />\n      <div class=\"timestamps\">\n        <h4>Timestamps :</h4>\n        <p>\n          <a class=\"link\" id=\"viewpref\" (click)=\"gotost(1)\"\n            >1. View preferences, check the timeline and select a theme</a\n          >\n        </p>\n        <br />\n        <p>\n          <a class=\"link\" id=\"editpref\" (click)=\"gotost(2)\"\n            >2. Edit preferences</a\n          >\n        </p>\n        <br />\n        <p>\n          <a class=\"link\" id=\"editProfile\" (click)=\"gotost(3)\"\n            >3. Edit profile</a\n          >\n        </p>\n      </div>\n    </div>\n  </mat-tab>\n  <mat-tab label=\"Faculty/Co-ordinator\" *ngIf=\"isFaculty() || isSuperAdmin()\">\n    <mat-tab-group\n      *ngIf=\"index == 2\"\n      [selectedIndex]=\"0\"\n      [backgroundColor]=\"background\"\n      dynamicHeight=\"true\"\n      mat-align-tabs=\"center\"\n    >\n      <mat-tab label=\"Faculty\">\n        <div class=\"container\">\n          <h1 class=\"head\">\n            <b><u>Faculty Guide</u></b>\n          </h1>\n          <video class=\"video\" #helpvidsa controls name=\"media\">\n            <source src=\"../../../assets/Faculty.mp4\" type=\"video/mp4\" />\n          </video>\n          <!-- <iframe #helpvid class=\"video\" width=\"967\" height=\"544\" src=\"../../../assets/Student.mp4\" frameborder=\"0\" allowfullscreen></iframe> -->\n          <br />\n          <div class=\"timestamps\">\n            <h4>Timestamps :</h4>\n            <p>\n              <a class=\"link\" id=\"viewpref\" (click)=\"gotofa(1)\">1. Home Page</a>\n            </p>\n            <br />\n            <p>\n              <a class=\"link\" id=\"editpref\" (click)=\"gotofa(2)\"\n                >2. Add/Delete Programs</a\n              >\n            </p>\n            <br />\n            <p>\n              <a class=\"link\" id=\"editProfile\" (click)=\"gotofa(3)\"\n                >3. Add/Edit/Delete Projects</a\n              >\n            </p>\n            <br />\n            <p>\n              <a class=\"link\" id=\"editProfile\" (click)=\"gotofa(4)\"\n                >4. Student Preference</a\n              >\n            </p>\n          </div>\n        </div>\n      </mat-tab>\n\n      <mat-tab label=\"Co-ordinator\">\n        <div class=\"container\">\n          <h1 class=\"head\">\n            <b><u>Co-ordinator Guide</u></b>\n          </h1>\n          <video class=\"video\" #helpvidad controls name=\"media\">\n            <source src=\"../../../assets/Admin_Remade.mp4\" type=\"video/mp4\" />\n          </video>\n          <!-- <iframe #helpvid class=\"video\" width=\"967\" height=\"544\" src=\"../../../assets/Student.mp4\" frameborder=\"0\" allowfullscreen></iframe> -->\n          <br />\n          <div class=\"timestamps\">\n            <h4>Timestamps :</h4>\n            <p>\n              <a class=\"link\" id=\"viewpref\" (click)=\"gotoad(1)\">1. Home Page</a>\n            </p>\n            <br />\n            <p>\n              <a class=\"link\" id=\"editpref\" (click)=\"gotoad(2)\"\n                >2. Allocation Stage</a\n              >\n            </p>\n            <br />\n            <p>\n              <a class=\"link\" id=\"editProfile\" (click)=\"gotoad(3)\"\n                >3. Mangagin Stream Details</a\n              >\n            </p>\n          </div>\n        </div>\n      </mat-tab>\n    </mat-tab-group>\n  </mat-tab>\n  <mat-tab label=\"Super Admin\" *ngIf=\"isSuperAdmin()\">\n    <div class=\"container\">\n      <h1 class=\"head\">\n        <b><u>Super admin's guide for the application.</u></b>\n      </h1>\n      <video class=\"video\" #helpvidsa controls name=\"media\">\n        <source src=\"../../../assets/SuperAdminVideo.mp4\" type=\"video/mp4\" />\n      </video>\n      <!-- <iframe #helpvid class=\"video\" width=\"967\" height=\"544\" src=\"../../../assets/Student.mp4\" frameborder=\"0\" allowfullscreen></iframe> -->\n      <br />\n      <div class=\"timestamps\">\n        <h4>Timestamps :</h4>\n        <p>\n          <a class=\"link\" id=\"viewpref\" (click)=\"gotosa(1)\"\n            >1. Faculty guide.</a\n          >\n        </p>\n        <br />\n        <p>\n          <a class=\"link\" id=\"editpref\" (click)=\"gotosa(2)\"\n            >2. Student guide.</a\n          >\n        </p>\n        <br />\n        <p>\n          <a class=\"link\" id=\"editProfile\" (click)=\"gotosa(3)\"\n            >3. Project guide</a\n          >\n        </p>\n        <br />\n        <p>\n          <a class=\"link\" id=\"editProfile\" (click)=\"gotosa(4)\"\n            >4. Streams and programs</a\n          >\n        </p>\n      </div>\n    </div>\n    <hr />\n\n    <mat-card class=\"stages-card\">\n      <mat-card-content>\n        <div class=\"instructions\">\n          <h1 class=\"supertext\">\n            <b\n              >The below text is the information on how to add streams or\n              programs.</b\n            >\n          </h1>\n        </div>\n        <hr />\n        <br />\n        <pre>\n            <b><u>Streams Tab</u></b> : This tab is for adding any new streams in the institute.\n\n                    The + button on the top of the table can be used to add a new branch and the delete button can be used to remove the branch.\n\n            <b><u>Programs Tab</u></b> : This tab is for adding any new programs within the provided streams.\n\n                    This tab requires mapping to the roll.no of the students of that particular program. The + button on the top of the table can be used to add a new\n                    program and the delete button can be used to remove the program.\n\n            <b><u>Explanation:</u></b>\n\n                Now let us consider that IIT Palakkad has four core streams\n                    1. Computer Science and Engineering(CSE)\n                    2. Electrical Engineering(EE)\n                    3. Mechanical Engineering(ME)\n                    4. Civil Engineering(CE)\n\n                The above four streams must be added one by one in the streams tab:\n\n                <b>For CSE:</b>\n\n                    name : Computer Science and Engineering\n                    short :  CSE\n                    Similarly the other streams can be added.\n\n\n\n                Now these streams further contain many programs such as UG, PG etc. For now let us consider that there are only two programs UG and PG.\n\n                These programs will have to be registered under the programs tab.\n                    Click on the + button to add programs  and in the pop-up fill in the required details.\n                    Example:\n                        Let us consider the UG and PG programs must be added in the CSE stream.\n                        Now click on + button, In the pop-up the fill the required details,\n\n                <b>For UG:</b>\n\n                    Name: UG-Computer Science and Engineering or any other suitable name.\n                    Short: UG-CSE or any other suitable name. (allowed characters are letters, underscore and hyphen).\n                    Map: This field needs a simple regex to identify the students of that particular program from their roll number.\n                    Example:\n                        For UG-CSE the current roll numbers are 111801***\n                        So here the map would be 0|11\n                        For UG-EE the current roll numbers are 121801***\n                        So here the map would be 0|12\n\n\n                    <b><u>Split up of the map:</u></b>\n\n                    The numbers to the left of the pipe('|') must tell the number of characters in the roll number before the occurrence of the unique pattern for that\n                    program.\n                    For UG-CSE, UG-EE, UG-ME, UG-CE the roll numbers are 11, 12., 13., 10 respectively the unique patterns are 11,12,13,10 respectively and the\n                    number of characters before that is 0 so the map for each program would be 0|11, 0|12, 0|13, 0|10 respectively.\n\n                    Similarly the CSE program for PG can also be added.\n\n            </pre>\n      </mat-card-content>\n    </mat-card>\n  </mat-tab>\n</mat-tab-group>\n");

